import ReviewItem from "./ReviewsItem";
import Slider from "react-slick";

export default function ReviewList(){
    render()
    {
        const settings = {
            dots: false,
            infinite: true,
            speed: 500,
            slidesToShow: 1,
            slidesToScroll: 1
        };

        return (
            <div>
                <h2> Single Item</h2>
                <Slider {...settings}>
                    <ReviewItem/>
                    <ReviewItem/>
                    <ReviewItem/>
                </Slider>
            </div>

        )
    }
}
